import { Box, Stack, Text, Center, Grid } from "@mantine/core";
import React from "react";

const Layout = ({ bgColor, borderRadius, columns }) => {
  return (
    <Box
      p={20}
      bg={bgColor}
      h={200}
      style={{
        borderRadius: `${borderRadius}px`,
      }}
    >
      <Stack spacing={0}>
        <Grid ml="xs" mr="xs">
          <Grid.Col span={columns}>
            <Box
              bg="blue.1"
              h={60}
              style={{
                border: "1px solid #000000",
              }}
            ></Box>
          </Grid.Col>
        </Grid>
      </Stack>
    </Box>
  );
};

export default Layout;
